ate Pages'=>'Slette private sider','Delete Pages'=>'Slette sider','Delete Others\' Pages'=>'Slette andres sider','Edit Files'=>'Redigere filer','Edit Dashboard'=>'Redigere kontrollpanelet','If you reached this page by accident and meant to visit one of your own sites, try one of the following links.'=>'Om du har kommet til denne siden og mente å besøke en av dine egne nettsteder, prøv en av følgende lenker.','Require authentication for access to the REST API.'=>'Krev autentisering for tilgang til REST API.','Show human-readable capabilities when possible.'=>'Vi menneske-lesbare tillatelser når mulig','Some add-ons may require purchase before downloading them. Clicking the purchase button will take you off-site to view the add-on in more detail.'=>'Noen tillegg kan kreve kjøp før nedlasting. Klikker du på disse vil du sendes til eksterne nettsteder å å se flere detaljer om tillegget.','Some plugins may be available for direct download. In such cases, you can click the download button to get a ZIP file of the plugin.'=>'Noen tillegg kan være tilgjengelig for direkte nedlasting. I slike tilfeller kan du få en ZIP-fil ved å klikke på nedlastningsknappen.','There are currently no add-ons to show. Please try again later.'=>'Det er for iden ingen tilleggsprogrammer. Vennligst prøv igjen senere.','One of the selected users is not a member of this site.'=>'En av de valgte brukerne er ikke medlem av dette nettstedet.','The current user&#8217;s role must have user editing capabilities.'=>'Rollen til inneværende bruker må ha tillatelser til å redigere brukere.','The Add-Ons screen allows you to view available add-ons for the Members plugin. You can download some plugins directly. Others may be available to purchase.'=>'Skjermbildet for tillegg lar deg se tilgjengelige programtillegg for Members. Du kan laste ned noen tillegg direkte. Andre kan være tilgjengelig for å kjøpe.','Members requires PHP version %1$s. You are running version %2$s. Please upgrade and try again.'=>'Members krever PHP-versjon %1$s. Du kjører versjon %2$s. Vennligst oppgrader og prøv på nytt.','Tick the checkbox to show human-readable capabilities when possible. Note that custom capabilities and capabilities from third-party plugins will show the machine-readable capability name unless they are registered.'=>'Kryss av for å benytte menneske-lesbare tillatelser når mulig. Merk at egendefinerte tillatelser og tillatelser fra tredjepartsutvidelser vil benytte maskinlesbare tillatelser så lenge de ikke er registrert.','Restrict Content'=>'Begrens innhold','Read'=>'Lese','The %s role is typically the most important role on the site. Please take extreme caution that you do not inadvertently remove necessary capabilities.'=>'Rollen %s er den mest betydningsfulle rollen på dette nettstedet. Vennligst pass ytterst nøye på at du ikke fjerner nødvendige tillatelser ved en feiltakelse.','Visit the %s page in the WordPress Codex to see a complete list of roles, capabilities, and their definitions.'=>'Besøk siden %s i WordPress Codex en fullstendig liste over roller, tillatelser og definisjonen av disse.','Order By:'=>'Sorter etter:','Members'=>'Members','Method does not exist.'=>'Metoden eksisterer ikke.','You must be logged into the site to view this content.'=>'Du må være innlogget for å se dette innholdet.','Sorry, but you do not have permission to view this content.'=>'Beklager, du har ikke tillatelse til å se dette innholdet.','Search:'=>'Søk:','Exclude:'=>'Ekskluder:','Include:'=>'Inkluder:','Limit:'=>'Grense:','URL'=>'URL','Registered'=>'Registrert','Order:'=>'Rekkefølge:','Meta Value:'=>'Metaverdi:','Meta Key:'=>'Metanøkkel:','Offset:'=>'Offset:','Post Count'=>'Antall innlegg','A user and role management plugin that puts you in full control of your site\'s permissions. This plugin allows you to edit your roles and their capabilities, clone existing roles, assign multiple roles per user, block post content, or even make your site completely private.'=>'En bruker- og rollehåndteringsutvidelse som gir deg full kontroll over tillatelser på ditt nettsted. Denne utvidelsenen lar deg endre roller og deres tillatelser, kopiere fra eksisterende roller, tildele flere roller pr. bruker, blokkere innhold, eller til og med gjøre nettstedet ditt fullstendig privat.','Login'=>'Logg Inn','None'=>'Ingen','Edit'=>'Rediger','Delete'=>'Slett','Password'=>'Passord','Plugins'=>'Utvidelser','Update'=>'Oppdater','Users'=>'Brukere','Title:'=>'Tittel:','Username'=>'Brukernavn','Remember Me'=>'Husk meg','General'=>'Generelt','Overview'=>'Oversikt','Documentation'=>'Dokumentasjon','Taxonomies'=>'Taksonomier','Clone'=>'Klone','ID'=>'ID','Email'=>'E-post','Display Name'=>'Visningsnavn','Descending'=>'Synkende','Ascending'=>'Stigende','Members: Users'=>'Medlemmer: Brukere','Logged in text:'=>'Innlogget-tekst:','Logged out text:'=>'Utlogget-tekst:','Mine %s'=>'Min %s' . "\0" . 'Mine %s','WordPress'=>'WordPress','WordPress %s'=>'WordPress %s' . "\0" . 'WordPress %s','You are currently logged in.'=>'Du er innlogget.','For more information:'=>'For mer informasjon:','Custom'=>'Egendefinert','Appearance'=>'Utseende','OK'=>'OK','User Roles'=>'Brukerroller','All'=>'Alle','Are you sure you want to delete this role? This is a permanent action and cannot be undone.'=>'Er du sikker på at du vil slette denne rollen? Denne handlingen er permanent og kan ikke angres.','Support Forums'=>'Støtteforum','Role and Capabilities'=>'Roller og tillatelser','Error Message'=>'Feilmelding','Deny'=>'Nekte','Grant'=>'Innvilge','Capability'=>'Tillatelse','Uneditable %s'=>'Uredigerbar %s' . "\0" . 'Uredigerbare %s','Editable %s'=>'Redigerbar %s' . "\0" . 'Redigerbare %s','No Users %s'=>'Ingen bruker %s' . "\0" . 'Ingen brukere %s','Bulk Actions'=>'Massehandlinger','Role Name'=>'Rollenavn','Add Role'=>'Legg til rolle','delete roleDelete'=>'Slett','Denied:'=>'Nektet:','Granted:'=>'Innvilget:','Users:'=>'Brukere:','Role'=>'Rolle','Custom Capability'=>'Egendefinert tillatelse','Content Permissions'=>'Innholdstillatelser','Edit Role'=>'Rediger rolle','Roles'=>'Roller','Edit Capabilities: %s'=>'Rediger tillatelser: %s','Deny %s capability'=>'Nekte tillatelsen %s','Grant %s capability'=>'Innvilge tillatelsen %s','If no roles are selected, everyone can view the content. The author, any users who can edit the content, and users with the %s capability can view the content regardless of role.'=>'Om ingen roller velges kan alle se innholdet. Forfatteren, enhver bruker som kan redigere innholdet og brukere med tillatelsen %s kan se innholdet, uansett rolle.','The %s role has been created.'=>'Rollen %s er opprettet.','The %s role is not editable. This means that it is most likely added via another plugin for a special use or that you do not have permission to edit it.'=>'Rollen %s er ikke redigerbar. Dette betyr at den mest trolig er lagt til av en annen utvidelse for spesiell bruk, eller at du ikke har tillatelse til å redigere den.','Available Actions'=>'Tilgjengelige handlinger','Screen Content'=>'Skjerminnhold','%s role deleted.'=>'Rollen %s slettet.','Selected roles deleted.'=>'Valgte roller slettet.','Denied'=>'Nektet','Granted'=>'Innvilget','Enter role name'=>'Oppgi rollenavn','Clone Role'=>'Klone rolle','%s Clone'=>'%s-klone','The %s role already exists.'=>'Rollen %s finnes allerede.','You must enter a valid role.'=>'Du må oppgi en gyldig rolle.','Add New Role'=>'Legg til ny rolle','All %s'=>'Alle %s' . "\0" . 'Alle %s','Change Default'=>'Endre standard','View'=>'Se','Your Role'=>'Din rolle','Default Role'=>'Standard rolle','Role:'=>'Rolle:','You must enter a valid role name.'=>'Du må oppgi et gyldig rollenavn.','Please log into the site.'=>'Vennligst logg inn på nettstedet.','Members: Login Form'=>'Members: Skjema for innlogging','A widget that allows users to log into your site.'=>'En widget som lar brukere logge inn på ditt nettsted.','The requested role to edit does not exist.'=>'Den forespurte rollen å redigere fines ikke.','Provides the ability to list the users of the site.'=>'Gir tilgang til å se en oversikt over brukere på nettstedet','Display avatar?'=>'Vise avatar?','Check "remember me"?'=>'Krysse av "Husk meg?"','"Remember me" checkbox?'=>'"Husk meg"-avkrysningsboks?','Multiple User Roles'=>'Flere brukerroller','Capabilities'=>'Tillatelser','Role Manager'=>'Rollebehandler','Private Site'=>'Privat nettsted','Sidebar Widgets'=>'Widgeter i sidestolpen','Roles and Capabilities'=>'Roller og tillatelser','admin screenMembers'=>'Medlemmer','Edit Capabilities'=>'Redigere tillatelelser','The private site feature redirects all users who are not logged into the site to the login page, creating an entirely private site. You may also replace your feed content with a custom error message.'=>'"Privat side"-funksjonen omdirigerer alle brukere som ikke er logget inn til innloggingssiden og skaper da et helt privat nettsted. Du kan også erstatte feeden med en egendefinert feilmelding.','Allow users to be assigned more than a single role.'=>'La brukere ha mer enn én rolle.','Enable the role manager.'=>'Aktiver rollebehandleren.','Your roles and capabilities will not revert back to their previous settings after deactivating or uninstalling this plugin, so use this feature wisely.'=>'Dine roller og tillatelser vil ikke tilbakestilles etter at du har avinstallert denne utvidelsen, så bruk denne funksjonen varsomt.','Enable Private Site'=>'Aktiver privat nettsted','Nice Name'=>'URL-vennlig navn','Username Value:'=>'Brukernavn-verdi:','Remember Me Label:'=>'Husk Meg-etikett:','Log In Label:'=>'Logg inn-etikett:','Password Label:'=>'Passord-etikett:','Log In'=>'Logg inn','Has Users %s'=>'Har brukere %s' . "\0" . 'Har Brukere %s','The custom capability box allows you to create a custom capability for the role. After hitting the Add New button, it will add the capability to the Custom tab in the Edit Capabilities box.'=>'Boksen for egendefinerte tillatelser lar deg sette tilpassede tillatelser for rollen. Når du klikker "Legg til ny" vil tillatelsen legges til i Egendefinert-fanen i boksen for egendefinerte tillatelser.','<strong>Grant</strong> allows you to grant the role a capability.'=>'<strong>Tillat</strong> lar deg gi en tilgang for rollen.','The capabilities edit box is made up of tabs that separate capabilities into groups. You may take the following actions for each capability:'=>'Boksen for redigering av egendefinerte tillatelser består av faner som separerer tillatelsene i grupper. Du kan gjøre følgende handlinger for hver tillatelse:','The machine-readable version of the role appears below the name field, which you can edit. This can only have lowercase letters, numbers, or underscores.'=>'Under navnefeltet vises rollen slik den leses av maskinen. Du kan endre den, men hold deg til små bokstaver, tall og understreker.','The role name field allows you to enter a human-readable name for your role.'=>'Rollenavn-feltet lar deg gi rollen et navn som er forståelig for mennesker.','This screen allows you to edit an individual role and its capabilities.'=>'Denne siden lar deg endre en individuell rolle og dens tillatelser.','Show error message for feed items.'=>'Vis feilmelding for feed-elementer.','Feed Error Message'=>'Feed-feilmelding','Disable Feed'=>'Deaktiver feed','Enable Permissions'=>'Aktiver tillatelser','You can permanently delete multiple roles at once. Select the roles you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.'=>'Du kan slette flere roller permanent på en gang. Velg rollene du vil endre med sjekkboksene, velg ønsket handling fra massehandlinger-menyen og klikk Bruk.','<strong>Users</strong> takes you to the users screen and lists the users that have that role.'=>'<strong>Brukere</strong> tar deg til brukersiden og viser brukere som har den rollen.','<strong>Clone</strong> copies the role and takes you to the new role screen to further edit it.'=>'<strong>Kopier</strong> kopierer rollen og tar deg til den nye rollesiden for videre redigering.','<strong>Delete</strong> removes your role from this list and permanently deletes it.'=>'<strong>Slett</strong> fjerner rollen din fra denne listen og sletter den permanent.','<strong>Edit</strong> takes you to the editing screen for that role. You can also reach that screen by clicking on the role name.'=>'<strong>Rediger</strong> tar deg til redigeringssiden for den rollen. Du kan også nå siden ved å klikke rollenavnet.','Username Label:'=>'Brukernavn-etikett:','Submit Button ID:'=>'ID for innsendingsknapp:','Password Field ID:'=>'ID for passordfelt:','Remember Me Field ID:'=>'ID for Husk meg-felt:','Username Field ID:'=>'ID for brukernavn-felt:','The sidebar widgets feature adds additional widgets for use in your theme\'s sidebars.'=>'Widgets-muligheten legger til ekstra widgeter som kan brukes i widgetområdene for ditt tema.','Denied capabilities should always overrule granted capabilities.'=>'Nektede tillatelser bør alltid overstyre gitte tillatelser.','<strong>Deny</strong> allows you to explicitly deny the role a capability.'=>'<strong>Nekte</strong> lar deg eksplisitt nekte en tillatelse for rollen.','You may also opt to neither grant nor deny the role a capability.'=>'Du kan også velge verken å gi eller nekte en tillatelse for rollen.','Redirect all logged-out users to the login page before allowing them to view the site.'=>'Omdiriger ikke-innloggede brukere til innloggingssiden før de får se dette nettstedet.','Update Settings'=>'Oppdater innstillingene','%s role updated.'=>'Rollen %s oppdatert.','Enable the content permissions feature.'=>'Aktiver funksjonaliteten for innholdsbegrensning.','Limit access to the content to users of the selected roles.'=>'Begrens tilgang til innholdet for brukere med bestemte roller.','You can customize the display of this screen&#8216;s contents in a number of ways:'=>'Du kan tilpasse visningen denne sidens innhold på mange ulike måter:','The multiple user roles feature allows you to assign more than one role to each user from the edit user screen.'=>'Funksjonen for flere brukerroller lar deg tilordne mer enn én rolle til hver bruker fra skjermen for redigering av brukere.','Tick the checkbox for denied capabilities to always take precedence over granted capabilities when there is a conflict. This is only relevant when using multiple roles per user.'=>'Kryss av i denne boksen for alltid å la nektede tillatelser overstyre gitte tillatelser når det er konflikt. Dette er bare relevant når man bruker flere roller pr. bruker.','Hovering over a row in the roles list will display action links that allow you to manage your role. You can perform the following actions:'=>'Å sveve pekeren over en rad i rollelisten vil vise handlingslenker som lar deg behandle din rolle. Du kan utføre følgende handlinger:','You can filter the list of roles by types using the text links in the upper left. The default view is to show all roles.'=>'Du kan filtrere rolleoversikten etter typer ved å bruke lenkene øverst til venstre. Standardvisningen er å vise alle roller.','You can hide/display columns based on your needs and decide how many roles to list per screen using the Screen Options tab.'=>'Du kan skjule/vis kolonner basert på dine behov og avgjøre hvor mange roller å vise pr. skjermside ved å bruke fane Visningsinnstillinger.','This screen provides access to all of your user roles. Roles are a method of grouping users. They are made up of capabilities (caps), which give permission to users to perform specific actions on the site.'=>'Denne skjermen gir tilgang til alle dine brukerroller. Roller er en metode for å gruppere brukere. De består av tillatelser (caps) som gir brukere adgang til å utføre bestemte handlinger på netstedet.','Whoah, partner!'=>'Rolig, partner!','The role manager allows you to manage roles on your site by giving you the ability to create, edit, and delete any role. Note that changes to roles do not change settings for the Members plugin. You are literally changing data in your WordPress database. This plugin feature merely provides an interface for you to make these changes.'=>'Rollebehandleren lar deg behandle roller på dit nettsted ved å gi deg muligheten til å opprette, redigere og slette enhver rolle. Merk at endringer av roller ikke endrer innstillingene for denne utvidelsen. Du endrer bokstavelig talt data i din WordPress-databasen. Denne funksjonen i utvidelsen gir deg bare et grensesnitt slik a du kan gjøre disse endringene.','The content permissions features adds a meta box to the edit post screen that allows you to grant permissions for who can read the post content based on the user\'s role. Only users of roles with the %s capability will be able to use this component.'=>'Funksjonene for innholdstillatelser legger til en metaboks på redigeringsskjermen, og som lar deg gi tillatelser til hvem som kan lese innholdet basert på brukerens rolle. Bare brukere i roller med tillatelsen %s vil kunne bruke denne komponenten.']];